    '美术馆里有一幅描写亚当和夏娃的画。\n一个英国人看了，说：“他们一定是英国人，男士有好吃的东西就和女士分享。”\n一个法国人看了，说：“他们一定是法国人，情侣裸体散步。”\n一个苏联人看了，说：“他们一定是苏联人，他们没有衣服，吃得很少，却还以为自己在天堂！',
    '莫斯科一老者人行道闲溜，不慎落入道旁河中。随高呼救命！\n两警察闻之，视若不见，仍边走边谈笑如旧。\n老者情急生智，随又高呼“打倒勃列日涅夫”！\n两警察闻之大惊，随急速跳入河中，将老者拖上岸来铐之。',
    '某日苏联举行国庆游行，沿着大街开来了炮兵、机械化步兵、坦克、自行火炮、战术导弹、战略核导弹，破坏力一个比一个大；队列末尾却是两个带公文包的矮子。\n在看台上勃列日涅夫惊讶地说：“这两个人破坏力比核导弹还大！他们是什么人？”\n克格勃头子说：“不是我的人。”\n国防部长说：“没见过他们。”\n苏联总理说：“他们是国家计委的……”\n【计委：计划经济委员会/纪委：纪律检查委员会】',
    '一个莫斯科市民的鹦鹉丢了。这是只会骂人的鹦鹉，要是落到克格勃的手里可糟了。\n这人便在报纸上发表了一篇声明：\n“本人遗失鹦鹉一只，另外，本人不同意它的政治观点。”',
    '一个英国人,一个法国人,一个苏联人谈论什么是世界上最幸福的事。\n英国人：最幸福的事情就是冬天晚上回家，穿着羊毛裤坐在壁炉前面。\n法国人：你们英国人就是古板，最幸福的事情是和一个金发女郎一起去地中海度假，然后我们好和好散。\n苏联人：最幸福的事情就是半夜有警察敲门，开门后：伊万，你被捕了。\n…：你弄错了，伊万在隔壁。',
    '勃列日涅夫和美国总统卡特在瑞士开会，休息时间两个人很无聊，就开始比谁的保镖更忠诚。\n卡特先来，他把自己的保镖叫进来，推开窗（外面是20层楼）说： “约翰，从这里跳下去！”\n约翰哭着说：“你怎么能这样呢，总统先生，我还有老婆孩子呐。”\n卡特被感动了，流着泪说是自己不对，叫约翰走了，然后轮到勃列日涅夫，他也大声叫自己的保镖伊万。\n“伊万，从这里跳下去！”\n伊万二话不说就要往下跳，卡特一把抱住他说：“你疯了？跳下去会死的！”\n伊万一边挣扎着要跳下去一边说：“放开我，混蛋，我还有老婆孩子呐。”',
    '列宁的夫人曾经当面指出斯大林的专制独裁统治，令后者气急败坏，斯大林说：“你再说，我就宣布你不是列宁的妻子！（历史事实）',
    '古巴举行盛大五一节游行，卡斯特罗率党和国家领导人全体出席，检阅游行队伍。\n就在游行队伍通过主席台的时候，卡斯特罗同志突然发现人群中有一个人掏出一块新手帕擦了擦鼻子，于是他马上对身边的一位政治局委员道：\n“我敢打赌，这个拿手帕擦鼻子的人里面没穿内裤！”\n委员不以为然，难道卡斯特罗同志真长了透视眼不成？他马上命令警卫把那个人叫道跟前，亲自询问，吃惊地发现，这人长裤里面果然是光着的。委员敬佩地问领袖：“卡斯特罗同志，您是如何知道透过外衣看见他没穿内裤的？”\n卡斯特罗回答：“我看见他掏出了新手帕，他的布票显然没用来买内裤嘛。”众人大惊，无不佩服领袖超凡的洞察力……',
    '美国人登月成功后,勃列日涅夫当天就打电话给苏联宇航员：\n“鉴于美国人已经在月球上登陆，现在苏联决定，马上派你们去太阳登陆”。\n宇航员大惊，哽咽道： “您不知道吗，勃列日涅夫同志，我们会被烧死的”。\n勃列日涅夫生气地说：“你以为政治局没有考虑过吗？我们已经决定，派你们在晚上在太阳登陆！”',
