    '二战结束后一个波兰农村老太看到街上贴着的照片就说像自己的外甥。。。\n别人训斥她：瞎说什么，这是斯大林同志！！\n老太：他是干什么的？\n答：他赶跑了纳粹！\n老太急切地问：他能不能把俄国人也赶跑啊？',
    '老师在莫斯科街上碰到以前的学生斯基洛夫（已经当了克格勃）。\n老师说：现在的学生学习可真不像话，上课时我问他们《叶甫盖尼·奥涅金》是谁写的，他们居然没人回答；逐个问，居然都说：\n“不是我写的。”\n斯基洛夫：这是一个问题，这件事交给我吧。\n过了一周，斯基洛夫兴致勃勃地找到老师：我审了他们几天，事情解决了，伊万那小子招了，是他写的！\n老师：…………\n【《叶甫盖尼·奥涅金》：普希金的著名作品】',
    '去买报纸，要一份《真理报》。报贩回答：《真理》没有了，只有《消息》。',
